                    {/* here it's print all data from API */}
                     {/* data ,null,2)ترتب اللي داخل API  */}
               {/* <pre> {JSON.stringify(data ,null,2)}</pre> */}


<div>

    
    <div className='BigBox'> 
        {data.datamap((elm)=>(

            <div className='SmallBox'>

            <h4>Task {elm.data}</h4>
            {/* <p key={elm.id}>{elm.title}</p>
            <p>{elm.description}</p> */}
 
            <button className='watch'>Watch</button>
            </div>
            
        ))}
        </div>
     
</div>
        </>
    )
}
